import api from './api';

class UserService {
  getPublicContent() {
    return api.get('/test/all');
  }

  getWalas() {
    return api.get('/test/walas');
  }

  getGuru() {
    return api.get('/test/guru');
  }

  getAdmin() {
    return api.get('/test/admin');
  }

  getUser() {
    return api.get('/test/user')
  }
}

export default new UserService();
